import React from 'react';
import s from "./Transport.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories";
import Adverts from "../../Adverts/Adverts";

const Transport = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={'Недвижимость'} imgPath={'./architect.svg'} urlCategory={'nedvijimost'}/>
            <Subcategories nameSubCat={'Машины'} imgPath={'./auto.svg'} urlSubcategory={'mashini'}/>
            <Subcategories nameSubCat={'Мотоциклы'} imgPath={'./moto.svg'} urlSubcategory={'motocicly'}/>
            <Category nameCategory={'Все для дома'} imgPath={'./household.svg'} urlCategory={'all_for_home'}/>
          </div>
        </div>

        <Adverts categoryName={'Транспорт'} listAd={props.listAd}/>
      </div>
  );
};

export default Transport;
